import cardBackground from './cardBackground'

function Card(title, backgroundURL) {

    const cardStyle = {
        backgroundImage: url("https://s3-eu-west-1.amazonaws.com/course.oc-static.com/projects/front-end-kasa-project/accommodation-20-1.jpg"),
        backgroundPosition: "center",
    }

    return (
        <div className="cardContainer">
            <div className="card" style={cardStyle}>
                <h1>test</h1>
            </div>
        </div>
    )
}

export default Card;
